import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Home from './Home'; // Import the 'Home' component if it's defined in a separate file

const NewsItem = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      const response = await axios.get('https://newsapi.org/v2/top-headlines?country=us&apiKey=a612a032fc214df2962a6fcd6d4fe944');
      setData(response.data.articles);
    };
    getData();
  }, []);

  console.log(data);

  return (
    <div>
      <Home data={data} /> {/* Pass the 'data' array as a prop to the 'Home' component */}
    </div>
  );
};

export default NewsItem;
